INSERT INTO `resolucion` VALUES (1,'Que en virtud de las Resoluciones No. 009 del 15 de enero de 2020 el se√±or Rector de la Universidad Distrital Francisco Jos√© de Caldas delega en el Decano de la Facultad de Medio Ambiente y Recursos Naturales la ordenaci√≥n del gasto y la contrataci√≥n para el rubro de Practicas Acad√©micas Facultad del Medio Ambiente.','Que mediante Resoluci√≥n del Consejo Superior Universitario No. 004 del 4 de marzo de 2003, se establecen las escalas salariales de las distintas categor√≠as de empleos de la Universidad Distrital Francisco Jos√© de Caldas y se dictan otras disposiciones.','Que en el art√≠culo cuarto de la Resoluci√≥n de la Rector√≠a No. 311 del 25 de junio de 2019, se establece que: ‚Äúpara la realizaci√≥n de pr√°cticas acad√©micas, a los docentes de carrera y de vinculaci√≥n especial, s√≥lo se les podr√°n reconocer vi√°ticos, a 31 de diciembre de 2003, hasta por el valor de SESENTA Y CINCO MIL PESOS ($65.000) MC/TE por d√≠a pernoctado. Dicha suma, se reajustar√° anualmente en un porcentaje igual al incremento del √≠ndice de Precios al Consumidor (1.P.C.) Nacional, que registre el DANE a 31 de diciembre de cada','Que mediante Resoluci√≥n de Rector√≠a No. 311 del 25 de junio de 2019, se reglamenta el procedimiento general de solicitud de los avances, aprobaci√≥n, desembolso y su correspondiente legalizaci√≥n en la Universidad.','Que en el art√≠culo tercero de la Resoluci√≥n de Rector√≠a No. 311 del 25 de junio de 2019, se establecen las modalidades de avances.','Que en el art√≠culo primero del Acuerdo 012 del 24 de octubre de 2019 el Consejo Superior modific√≥ el Art√≠culo del Acuerdo No. 010 de 1988, en el cual determin√≥ que:','\"ART√çCULO 2¬∞. Los estudiantes que deban realizar pr√°cticas acad√©micas fuera de la ciudad de Bogot√° en el territorio Nacional, seg√∫n la normatividad interna, recibir√°n un auxilio econ√≥mico equivalente al valor de uno punto dos (1.2) Salarios M√≠nimos Diarios Legales Mensuales Vigentes ‚ÄîSMDLV, cuando la pr√°ctica sea por un solo  d√≠a.','En el caso que las pr√°cticas sean por dos (2) o m√°s d√≠as, los estudiantes recibir√°n un auxilio econ√≥mico equivalente al valor de uno punto ocho 0.8) Salarios M√≠nimos Diarios Legales Mensuales Vigentes ‚ÄîSMDLV, por cada uno de los d√≠as de pr√°ctica acad√©mica\"','Que se hace necesario autorizar el tr√°mite de un avance a la Divisi√≥n Financiera de la Universidad Distrital Francisco Jos√© de Caldas, y as√≠ mismo el manejo y ejecuci√≥n del mismo a un docente de  la una actividad acad√©mica.','Que los planes de pr√°cticas de los diferentes Proyectos Curriculares adscritos a la Facultad del Medio Ambiente y Recursos Naturales se aprobaron por el Consejo de Facultad mediante sesi√≥n del',NULL,'** El vi√°tico de cada docente es de  (el n√∫mero de d√≠as ‚Äì 0.5)  * $','El auxilio de cada estudiante  para pr√°cticas de un d√≠a cuyo destino es fuera de la ciudad de Bogot√° es de $','El auxilio diario de cada estudiante  para pr√°cticas de m√°s de un d√≠a cuyo destino es fuera de la ciudad de Bogot√°  es de $','Que el Decano de la Facultad del Medio Ambiente y Recursos Naturales en uso de sus facultades legales y especialmente las contempladas en el Articulo 91 del Acuerdo 11 de 2002, literal e, concede comisi√≥n para adelantar actividades relacionadas con su actividad acad√©mica al (los) docente(s) que participara(n) en la(s) pr√°ctica(s) acad√©mica(s) descrita es este acto administrativo','Delegar al citado docente para el manejo y legalizaci√≥n de los recursos entregados','La presente Resoluci√≥n rige a partir de la de fecha de su expedici√≥n.');
